export default function Vertical() {
  return (
    <div>

<div className="container text-center" style={{marginLeft:'0rem',marginRight:'2rem' ,width:'5rem'}} >
 
  

        <button className='btn btn-warning'>Home</button>
        <button className='btn btn-warning'>Login </button>
        <button className='btn btn-warning'>Womens</button>
        <button className='btn btn-warning'>Kids</button>
    
    
 
</div>
      
    </div>
  )
}
